import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';
import Menu from "./component/pages/menu"
import { FooterDown} from "./component/pages/footer"

function App() {
  return (
    <div className="App">

        <Menu/>


     <div className="footer">

       <FooterDown/>

     </div>
    </div>
  );
}

export default App;
